Highlight:<span class="hljs-function"><span class="hljs-keyword">function</span> <span class="hljs-title">map</span>(<span class="hljs-params">array, transform</span>) </span>{
  <span class="hljs-keyword">var</span> mapped = [];
  <span class="hljs-keyword">for</span> (<span class="hljs-keyword">var</span> i = <span class="hljs-number">0</span>; i &lt; array.length; i++)
    mapped.push(transform(array[i]));
  <span class="hljs-keyword">return</span> mapped;
}

<span class="hljs-keyword">var</span> overNinety = ancestry.filter(<span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params">person</span>) </span>{
  <span class="hljs-keyword">return</span> person.died - person.born &gt; <span class="hljs-number">90</span>;
});
<span class="hljs-built_in">console</span>.log(map(overNinety, <span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params">person</span>) </span>{
  <span class="hljs-keyword">return</span> person.name;
}));
<span class="hljs-comment">// → ["Clara Aernoudts", "Emile Haverbeke",</span>
<span class="hljs-comment">//    "Maria Haverbeke"]</span>
