Highlight:Но вызов функций в JavaScript обходится дороже по сравнению с циклами
Highlight:<p class="comments-section">Сравните два рецепта горохового супа:<div class="comments-icon"><div class="marker">+</div></div></p>
<p class="comments-section"><i>Добавьте в ёмкость по одной чашке сухого гороха на порцию. Добавьте воды так, чтобы она покрыла горох. Оставьте его так минимум на 12 часов. Выньте горох из воды и поместите его в кастрюлю. Добавьте 4 чашки воды на порцию. Закройте кастрюлю и тушите горох два часа. Возьмите по половине луковицы на порцию. Порежьте на куски ножом, добавьте к гороху. Возьмите по одному стеблю сельдерея на порцию. Порежьте на куски ножом, добавьте к гороху. Возьмите по морковке на порцию. Порежьте на куски ножом, добавьте к гороху. Готовьте ещё 10 минут.</i><div class="comments-icon"><div class="marker">+</div></div></p>
<p class="comments-section">Второй рецепт:<div class="comments-icon"><div class="marker">+</div></div></p>
<p class="comments-section"><i>На порцию: 1 чашка сухого гороха, половина луковицы, стебель сельдерея, морковка.
Вымачивайте горох 12 часов. Тушите 2 часа в 4 чашках воды на порцию. Порежьте и добавьте овощи. Готовьте ещё 10 минут.</i><div class="comments-icon"><div class="marker">+</div></div></p>
<p class="comments-section">Второй – короче и проще. Но вам нужно знать чуть больше понятий, связанных с готовкой – вымачивание, тушение, резка (и овощи).</p>
Highlight:Удобно примерно подсчитывать, как часто будет вызываться данный кусочек кода. Если у вас есть цикл в цикле (напрямую, или же через вызов в цикле функции, которая внутри также работает с циклом), то код будет выполнен N×M раз, где N – количество повторений внешнего цикла, а M – внутреннего. Если во внутреннем цикле есть ещё один цикл, повторяющийся P раз, тогда мы уже получим N×M×P, и так далее. Это может приводить к большим числам, и когда программа тормозит, проблему часто можно локализовать в небольшом кусочке кода, находящемся внутри самого внутреннего цикла.
Highlight:<span class="hljs-function"><span class="hljs-keyword">function</span> <span class="hljs-title">greaterThan</span>(<span class="hljs-params">n</span>) </span>{
  <span class="hljs-keyword">return</span> <span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params">m</span>) </span>{ <span class="hljs-keyword">return</span> m &gt; n; };
}
<span class="hljs-keyword">var</span> greaterThan10 = greaterThan(<span class="hljs-number">10</span>);
<span class="hljs-built_in">console</span>.log(greaterThan10(<span class="hljs-number">11</span>));
<span class="hljs-comment">// → true</span>
Highlight:Вместо того, чтобы впутывать алгоритм в большой цикл, всё распределено по концепциям, которые нас интересуют – определение пола, подсчёт возраста и усреднение чисел. Мы применяем их по очереди для получения результата.

